import {
	Grid,
	InputAdornment,
	InputLabel,
	Typography,
} from '@material-ui/core';
import React, { useState } from 'react';
import AddIcon from '@material-ui/icons/Add';

function Add(props) {
	const [term, setTerm] = useState('');

	return (
		<Grid justify="center">
			<Typography align="center">Add</Typography>{' '}
			<form
				noValidate
				// onSubmit={(e) => {
				// 	e.preventDefault();
				// 	props.submitAction(term);
				// }}
				className="form-search"
			>
				<InputLabel
					id="outlined-basic"
					color="secondary"
					label="Search"
					variant="outlined"
					fullWidth
					value={term}
					placeholder="Enter GitHub User"
					onChange={(e) => {
						setTerm(e.target.value);
					}}
					size="small"
					InputProps={{
						startAdornment: (
							<InputAdornment position="start">
								<AddIcon />
							</InputAdornment>
						),
					}}
				/>
			</form>
		</Grid>
	);
}

export default Add;
